// src/App.js
import React from 'react';
import './styles/globals_css.css';

const App = () => {
  return (
    <div className="app">
      <div className="bg-gray-100 min-h-screen">
        <div className="max-w-sm mx-auto bg-white rounded-3xl shadow-2xl overflow-hidden">
          <div className="px-6 py-6">
            <h1 className="text-2xl font-bold text-gray-900 mb-4">XPenses App</h1>
            <p className="text-gray-600">Welcome to your expense tracker!</p>
            <div className="mt-4 p-4 bg-blue-50 rounded-lg">
              <p className="text-blue-800">If you can see this styled content, Tailwind CSS is working!</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
